import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    borderRadius: 40,
    borderWidth: 3,
    borderColor: "#ae22e0",
  },
  image: {
    margin: 7,
    borderRadius: 40,
    borderWidth: 1,
    borderColor: "#ffffff",
  },
});

export default styles;
